import { parseColorHexRGB } from "@microsoft/fast-colors";
export const white = "#FFFFFF";
export const black = "#000000";
export const accentBaseColor = "#0078D4";
export const neutralBaseColor = "#808080";
/**
 * @deprecated
 */
const paletteConstants = {
    steps: 94,
    clipLight: 0,
    clipDark: 0,
};
/**
 * @deprecated
 */
export const neutralPaletteConfig = Object.assign({}, paletteConstants);
/**
 * @deprecated
 */
export const accentPaletteConfig = Object.assign({}, paletteConstants, { baseColor: parseColorHexRGB("#0078D4") });
